import axios from 'axios';

//import constants
import {GET_DOGS} from './constants'

export const getDogs = () => {
    return async function (dispatch){
        const json = await axios.get('http://localhost:3001/dogs');
        return dispatch({
            type: GET_DOGS,
            payload: json.data
        })
    }
}
